  background-color: grey;
  border-radius: 50px;
  color: rgb(255, 255, 255);
  font-weight: 500;
  margin-left: 7rem;
`;

const Dis = styled.div`
  display: flex;
  align-items: center;
  max-width: 1280px;
  width: 80%;
  margin: 0 auto;
  padding: 1.5rem 0;
  position: relative;
  flex-direction: column;
  flex-wrap: nowrap;
